import React from 'react'
import {useHistory} from 'react-router-dom'
import injectSheet from "react-jss";
import styles from './EmptyFavouritesStyles'

const EmptyFavourites = (props) => {

    const {classes} = props;
    const history = useHistory();
    const goHome = () => {

        history.push('/')
    }
        return (
            <div className={classes.emptyList}>
                <div className={classes.header}>Favourite List is Empty! </div>
                <div className={classes.header}>Go back to home page and add some products to favourite list! </div>
                <div>
                    <button className={classes.btnGoHome} onClick={goHome}>
                        Go to home page
                    </button>
                </div>
            </div>
        )
    }

export default injectSheet(styles)(EmptyFavourites)
